import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { getUserById, updateUser } from "../../services/userService";

const EditUserAdmin = () => {
  const navigate = useNavigate();
  const { userId } = useParams();
  const [userType, setUserType] = useState(''); 
  const [user, setUser] = useState({
    username: "",
    email: "",
    full_name: "",
    user_type: "",
    password: "",
  });

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const userData = await getUserById(userId);
        setUser(userData);
      } catch (error) {
        console.error("Failed to fetch user", error);
      }
    };

    fetchUser();
  }, [userId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser((prevUser) => ({
      ...prevUser,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await updateUser(userId, user);
      navigate("/adminhome");
    } catch (error) {
      console.error("Failed to update user", error);
    }
  };

  return (
    <div>
      <h2>Edit User</h2>
      <form onSubmit={handleSubmit}>
        <p className="name">Full Name:</p>
        <input
          type="text"
          placeholder="Your Name"
          name="full_name"
          value={user.full_name}
          onChange={handleChange}
        />
        <p className="name">Email:</p>
        <input
          type="email"
          placeholder="Your Email"
          name="description"
          value={user.email}
          onChange={handleChange}
        />
        <p className="name">Username:</p>
        <input
          type="text"
          placeholder="Your Username"
          name="username"
          value={user.username}
          onChange={handleChange}
        />
        <p className="name">Password:</p>
        <input
          type="password"
          placeholder="Your Password"
          name="password"
          value={user.password}
          onChange={handleChange}
        />
        <p className="name">User Type:</p>
        <input
          type="text"
          placeholder="Your Username"
          name="user_type"
          value={user.user_type}
          onChange={handleChange}
        />
        <select value={userType} onChange={(e) => setUserType(e.target.value)}>
            <option value="student">Student</option>
            <option value="tutor">Tutor</option>
          </select>
        <div className="button-group">
          <button className="save-button" type="submit">
            Save
          </button>
        </div>
      </form>


      <form onSubmit={handleSubmit}>
        <div>
          <label>Username:</label>
          <input type="text" name="username" value={user.username} onChange={handleChange} />
        </div>
        <div>
          <label>Email:</label>
          <input type="email" name="email" value={user.email} onChange={handleChange} />
        </div>
        <div>
          <label>Full Name:</label>
          <input type="text" name="full_name" value={user.full_name} onChange={handleChange} />
        </div>
        <div>
          <label>User Type:</label>
          <input type="text" name="user_type" value={user.user_type} onChange={handleChange} />
        </div>
        <div>
          <label>Password:</label>
          <input type="password" name="password" value={user.password} onChange={handleChange} />
        </div>
        <button type="submit">Update User</button>
      </form>
    </div>
  );
};

export default EditUserAdmin;
